import Link from 'next/link';

export default function Index() {
  return (

      <div className="container">

        <p id="about">ABOUT</p>
        <div className="home-title">
          <h1>Code <br /> Blue </h1>
        </div>
        <div className="home-text">
          <Link href="/menu">
            <a>enter</a>
          </Link>
        </div>

      <style jsx global>{`

        * { padding: 0; margin: 0 auto; box-sizing: border-box; }

        body {
          overflow: hidden;
          top: 0;
          right: 0;
          background: rgba(251, 202, 43, 1);
          display: block;
          width: 100vw;
          height: 100vh;
        }

        #about {
          float: right;
          padding: 25px;
          font-family: Montserrat;
          font-size: 100%;
        }

        .home-title { 
          float: left;
          text-align: left;
          padding-top: 10vh;
          margin-left: 10vw;
          height: 90%;
          display: block;
          padding-bottom: 10vh;
        }

        h1 { 
          font-family: Raleway; 
          font-size: 1000%;
        }

        .home-text { 
          float: right;
          display: block;
          text-align: left;
          margin-left: 10vw;
          width: 80vw;
          background: black;
          padding: 10px;
        } 

        a { 
          font-family: Montserrat; 
          font-size: 300%; 
          text-decoration: none;
          color: white;
        }    

      `}</style>

    </div>
  );
}
